mutation siteUpdateSecondaryAwsVSocket ( $accountId:ID! $updateSecondaryAwsVSocketInput:UpdateSecondaryAwsVSocketInput!) {
	site ( accountId:$accountId ) {
		updateSecondaryAwsVSocket ( input:$updateSecondaryAwsVSocketInput  )  {
			secondaryAwsVSocket {
				site {
					id
					name
				}
				id
				ipAddress
				subnet
				routeTableId
			}
		}
	}	
}
